package main

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"io/ioutil"
)

const jsonxCode = ""

const jsonxTestCode = ""

func Uncompress(str string) string {
	data, _ := base64.StdEncoding.DecodeString(str)
	rdata := bytes.NewReader(data)
	r, _ := gzip.NewReader(rdata)
	s, _ := ioutil.ReadAll(r)
	return string(s)
}

func GetJsonxCode() string {
	return Uncompress(jsonxCode)
}

func GetJsonxTestCode() string {
	return Uncompress(jsonxTestCode)
}
